use f1_database;

DROP TABLE IF EXISTS races;
CREATE TABLE races(
   raceId    INTEGER  NOT NULL PRIMARY KEY AUTO_INCREMENT
  ,year      INTEGER  NOT NULL
  ,round     INTEGER  NOT NULL
  ,circuitId INTEGER  NOT NULL
  ,name      VARCHAR(29) NOT NULL
  ,date      VARCHAR(20)
  ,time      VARCHAR(8)
  ,url       VARCHAR(63)
);


DROP TABLE IF EXISTS qualifying;
CREATE TABLE qualifying(
   qualifyId     INTEGER  PRIMARY KEY AUTO_INCREMENT
  ,raceId        INTEGER 
  ,driverId      INTEGER 
  ,constructorId INTEGER 
  ,number        INTEGER 
  ,position      INTEGER 
  ,q1            VARCHAR(7)
  ,q2            VARCHAR(7)
  ,q3            VARCHAR(7)
);

DROP TABLE IF EXISTS pitstops;
CREATE TABLE pitstops(
   raceId       INTEGER
  ,driverId     INTEGER 
  ,stop         INTEGER 
  ,lap          INTEGER 
  ,time         VARCHAR(8)
  ,duration     VARCHAR(7)
  ,milliseconds INTEGER 
);
